import React, { useRef, useState } from "react";
import "./Counter.css";
function Counter() {
  let ref1 = useRef("");
  const [exp, setexp] = useState("");
  const createExpr = (value) => {
    ref1.current = ref1.current + value;
    setexp(ref1.current);
  };
  const clearAll = () => {
    ref1.current = "";
    setexp(ref1.current);
  };
  const removeLastEle = () => {
    ref1.current = ref1.current.substring(0, ref1.current.length - 2);
    setexp(ref1.current);
  };
  const calculateExp = () => {
    console.log("evaluate");
  };
  return (
    <div>
      <button
        style={{
          background: "White",
          border: "0",
          borderRadius: "100%",
          width: "70px",
          height: "60px",
          margin: "5px",
        }}
      >
        <h1>{exp}</h1>
      </button>
      <br />
      <button id="App" onClick={clearAll}>
        <h1>CE</h1>
      </button>
      <button id="App1" onClick={createExpr("%")}>
        <h1>%</h1>
      </button>
      <button id="App3" onClick={removeLastEle}>
        <h1>{"<-"}</h1>
      </button>
      <button id="App1" onClick={createExpr("/")}>
        <h1>/</h1>
      </button>
      <br />
      <button id="App2" onClick={createExpr("7")}>
        <h1>7</h1>
      </button>
      <button id="App2" onClick={createExpr("8")}>
        <h1>8</h1>
      </button>
      <button id="App2" onClick={createExpr("9")}>
        <h1>9</h1>
      </button>
      <button id="App1" onClick={createExpr("*")}>
        <h1>X</h1>
      </button>
      <br />
      <button id="App2" onClick={createExpr("4")}>
        <h1>4</h1>
      </button>
      <button id="App2" onClick={createExpr("5")}>
        <h1>5</h1>
      </button>
      <button id="App2" onClick={createExpr("6")}>
        <h1>6</h1>
      </button>
      <button id="App1" onClick={createExpr("-")}>
        <h1>-</h1>
      </button>
      <br />
      <button id="App2" onClick={createExpr("1")}>
        <h1>1</h1>
      </button>
      <button id="App2" onClick={createExpr("2")}>
        <h1>2</h1>
      </button>
      <button id="App2" onClick={createExpr("7")}>
        <h1>3</h1>
      </button>
      <button id="App1" onClick={createExpr("7")}>
        <h1>+</h1>
      </button>
      <br />
      <button id="App2" onClick={createExpr("7")}>
        <h1>00</h1>
      </button>
      <button id="App2" onClick={createExpr("7")}>
        <h1>0</h1>
      </button>
      <button id="App2" onClick={createExpr("7")}>
        <h1>.</h1>
      </button>
      <button id="App" onClick={calculateExp}>
        <h1>=</h1>
      </button>
    </div>
  );
}

export default Counter;
